const wwsWidget={
trigger: function(status=''){
if('open'===status){
this.open();
jQuery(document.body).trigger('wws_widget_open');
}else if('close'===status){
this.close();
jQuery(document.body).trigger('wws_widget_close');
}else{
if(jQuery('.wws-popup').attr('data-wws-popup-status')=='0'){
this.open();
jQuery(document.body).trigger('wws_widget_open');
}else{
this.close();
jQuery(document.body).trigger('wws_widget_close');
}}
},
open: function(){
jQuery('.wws-popup').slideDown();
jQuery('.wws-popup').attr('data-wws-popup-status', '1');
jQuery('.wws-gradient').show();
},
close: function(){
jQuery('.wws-popup').slideUp();
jQuery('.wws-popup').attr('data-wws-popup-status', '0');
jQuery('.wws-gradient').hide();
},
autoPopup: function(delayInSeconds){
if('yes'!==sessionStorage.wwsAutoPopup){
setTimeout(function(){
if('0'==jQuery('.wws-popup').data('wws-popup-status')){
wwsWidget.trigger();
}
sessionStorage.wwsAutoPopup='yes';
}, Number(delayInSeconds * 1000));
}},
sendMessage: function(message='', whatsappNumber=''){
if(''===message||''===whatsappNumber){
return false;
}
if(this.is_mobile.any()){
window.open(wwsObj.whatsapp_mobile_api + '/send?phone=' + whatsappNumber + '&text=' + message + '');
}else{
window.open(wwsObj.whatsapp_desktop_api + '/send?phone=' + whatsappNumber + '&text=' + message + '');
}
jQuery(document.body).trigger('wws_message_sent');
return true;
},
sendGroupInvitation: function(groupID){
window.open('https://chat.whatsapp.com/' + groupID);
},
is_mobile: {
Android: function(){
return navigator.userAgent.match(/Android/i);
},
BlackBerry: function(){
return navigator.userAgent.match(/BlackBerry/i);
},
iOS: function(){
return navigator.userAgent.match(/iPhone|iPad|iPod/i);
},
Opera: function(){
return navigator.userAgent.match(/Opera Mini/i);
},
Windows: function(){
return navigator.userAgent.match(/IEMobile/i);
},
any: function(){
return(wwsWidget.is_mobile.Android()||wwsWidget.is_mobile.BlackBerry()||wwsWidget.is_mobile.iOS()||wwsWidget.is_mobile.Opera()||wwsWidget.is_mobile.Windows());
},
},
logAnalytics: function(message='N/A', number='N/A', through='', args={}){
jQuery.ajax({
url: wwsObj.admin_url,
type: 'post',
data: {
'action':   'wws_click_analytics',
'message':  message,
'number':   number,
'through':  through,
'support_person_id': args.supportPersonId||'-1',
'security': wwsObj.security_token,
}});
},
}
